// src/components/Projects.js
import React from 'react';
import './Projects.css';
import project1Image from '/Users/avi/Desktop/mywebsite/personal-website/src/fam.jpg'; // Example images, replace with actual paths
import project2Image from '../assets/project2.jpg';
import project3Image from '../assets/project3.jpg';

const Projects = () => {
  const projects = [
    {
      title: 'Portfolio Website',
      description: 'A personal portfolio website showcasing my projects and experiences.',
      link: 'https://github.com/your-portfolio',
      image: project1Image,
    },
    {
      title: 'Weather App',
      description: 'A weather forecasting application built using React and OpenWeather API.',
      link: 'https://github.com/weather-app',
      image: project2Image,
    },
    {
      title: 'Task Manager',
      description: 'A task management app that helps users keep track of their daily activities.',
      link: 'https://github.com/task-manager',
      image: project3Image,
    },
  ];

  return (
    <section id="projects" className="projects">
      <h2>Projects</h2>
      <div className="projects-grid">
        {projects.map((project, index) => (
          <div key={index} className="project-card">
            <a href={project.link} target="_blank" rel="noopener noreferrer">
              <img src={project.image} alt={`${project.title} screenshot`} className="project-image" />
            </a>
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            <a href={project.link} target="_blank" rel="noopener noreferrer">View Project</a>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
